import React, { useState } from "react";
import Modal from "react-bootstrap/Modal";
import Style from "./modal.module.scss";

export default function CardModal({ show, setShow, veiculo }) {
  useState(false);
  return (
    <>
      <Modal
        show={show}
        onHide={() => setShow(false)}
        dialogClassName="modal-90w"
        aria-labelledby="example-custom-modal-styling-title"
      >
        <Modal.Header closeButton>
          <Modal.Title id="example-custom-modal-styling-title">
            {veiculo.nome}
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <img
            className={Style.img}
            src={veiculo.imagem}
            alt="Imagem do veículo"
          />
          <h4>
            <label>{veiculo.ano}</label>
            <label>{veiculo.marca}</label>
            <label>{veiculo.potencia}</label>
            <label>{veiculo.cor}</label>
            <label>{veiculo.cabine}</label>
            <label>{veiculo.combustível}</label>
            <label>{veiculo.tipo_suspensao}</label>
            <label>{veiculo.km}</label>
          </h4>
        </Modal.Body>
      </Modal>
    </>
  );
}
